INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 401, 24, 102301, 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, "アヤネ", 10046, 0.0, 24001, 0.0, "2020/07/31 12:00:00", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 402, 24, 102301, 2, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2.21, "アヤネ", 10046, 0.0, 24002, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 403, 24, 102301, 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, "アヤネ", 10046, 0.0, 24003, 0.0, "2020/07/31 12:00:00", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 701, 24, 192201, 1, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, "アサヒ", 10046, 0.0, 24004, 0.0, "2020/07/31 12:00:00", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 702, 24, 192201, 2, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, "アサヒ", 10046, 0.0, 24005, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 703, 24, 192201, 1, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, "アサヒ", 10046, 0.0, 24006, 0.0, "2020/07/31 12:00:00", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 801, 24, 192301, 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, "部員３", 10046, 0.0, 24007, 0.0, "2020/07/31 12:00:00", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 802, 24, 192301, 2, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, "部員３", 10046, 0.0, 24008, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 803, 24, 192301, 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, "部員３", 10046, 0.0, 24009, 0.0, "2020/07/31 12:00:00", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 501, 24, 192501, 1, "やった！", 0.0, "", 10046, 0.0, 24010, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 502, 24, 192501, 1, "勝ったよ！", 0.0, "", 10046, 0.0, 24011, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 503, 24, 192501, 1, "いい調子！", 0.0, "", 10046, 0.0, 24012, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 111, 24, 113501, 2, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, "ミサト", 10046, 0.0, 24013, 0.0, "2020/07/31 12:00:00", 6);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 112, 24, 113501, 2, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, "ミサト", 10046, 0.0, 24014, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 113, 24, 113501, 2, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, "ミサト", 10046, 0.0, 24015, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 611, 24, 192401, 2, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, "ダイチ", 10046, 0.0, 24016, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 612, 24, 192401, 2, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, "ダイチ", 10046, 0.0, 24017, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 613, 24, 192401, 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, "ダイチ", 10046, 0.0, 24018, 0.0, "2020/07/31 12:00:00", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 211, 24, 113401, 1, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, "ハツネ", 10046, 0.0, 24019, 0.0, "2020/07/31 12:00:00", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 212, 24, 113401, 1, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, "ハツネ", 10046, 0.0, 24020, 0.0, "2020/07/31 12:00:00", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 213, 24, 113401, 2, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, "ハツネ", 10046, 0.0, 24021, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 311, 24, 106501, 2, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 3.17, "カヤ", 10046, 0.0, 24022, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 312, 24, 106501, 2, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, "カヤ", 10046, 0.0, 24023, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 313, 24, 106501, 1, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 2.89, "カヤ", 10046, 0.0, 24024, 0.0, "2020/07/31 12:00:00", 6);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 421, 24, 102301, 3, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3.71, "アヤネ", 10046, 0.0, 24025, 0.0, "2020/07/31 12:00:00", 4);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 721, 24, 192201, 1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 5.1, "アサヒ", 10046, 0.0, 24026, 0.0, "2020/07/31 12:00:00", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 821, 24, 192301, 3, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, "部員３", 10046, 0.0, 24027, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 521, 24, 192501, 1, "いい勝負だったよ\nまたやろうね", 0.0, "", 10046, 0.0, 24028, 0.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 101, 24, 113501, 2, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 5.62, "ミサト", 10046, 0.0, 24029, -360.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 102, 24, 113501, 2, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 9.58, "ミサト", 10046, 0.0, 24030, -360.0, "2020/07/31 12:00:00", 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 103, 24, 113501, 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, "ミサト", 10046, 0.0, 24031, -360.0, "2020/07/31 12:00:00", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 104, 24, 113501, 1, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 9.13, "ミサト", 10046, 0.0, 24032, -360.0, "2020/07/31 12:00:00", 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("2030/12/17 14:59:59", 105, 24, 113501, 2, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 8.27, "ミサト", 10046, 0.0, 24033, -360.0, "2020/07/31 12:00:00", 1);
